const Sobre = () => {
    return(
      <div class="sobre-container">
      <div class="sobre-text">
        <h1>Sobre</h1>
        <p>Este projeto foi criado no âmbito da disciplina Desenvolvimento Web do 1º ano do mestrado Design e Multimédia da Universidade de Coimbra, onde o objetivo era criar um website de caráter editorial. 

          Versus é um website dedicado à vida e obra de Fernando Pessoa e dos seus heterónimos, onde é possível ler ambos os poemas como as suas respetivas análises. Temos como propósito servir de auxilio para quem quiser aprender mais sobre este poeta.</p>
      </div>
      </div>

    )
   }

   export default Sobre;
